    "contracts/holder/HolderDoubleLinkedList.sol": {
      "content": "//SPDX-License-Identifier: UNLICENSED
pragma solidity 0.7.5;

import 'hardhat/console.sol';

contract HolderDoubleLinkedList {
    mapping(address => HolderElement) holderDLL;
    address public firstHolder;
    address public lastHolder;

    struct HolderElement {
        address next;
        address prev;
    }

    function getHolder(address _holder) external view returns (address, address) {
        return (holderDLL[_holder].next, holderDLL[_holder].prev);
    }

    function exist(address _holder) external view returns (bool) {
        return _exist(_holder);
    }

    // add new holder to the end of DLL
    function _add(address _holder) internal {
        require(_holder != address(0), "holder cannot be address 0");
        if (firstHolder == address(0)) {
            firstHolder = _holder;
            holderDLL[_holder] = HolderElement(address(0), address(0));
        } else {
            HolderElement storage lastHolderEle = holderDLL[lastHolder];
            lastHolderEle.next = _holder;

            holderDLL[_holder] = HolderElement(address(0), lastHolder);
        }

        lastHolder = _holder;
    }

    // remove a holder from DLL
    function _remove(address _holder) internal {
        require(_holder != address(0), "holder cannot be address 0");
        if (!_exist(_holder)) {
            return;
        }

        HolderElement storage deletedEle = holderDLL[_holder];
        if (_holder == firstHolder && _holder == lastHolder) {
            firstHolder = address(0);
            lastHolder = address(0);
        } else if (_holder == firstHolder) {
            firstHolder = deletedEle.next;
        } else if (_holder == lastHolder) {
            lastHolder = deletedEle.prev;
        }

        holderDLL[deletedEle.next].prev = deletedEle.prev;
        holderDLL[deletedEle.prev].next = deletedEle.next;

        delete holderDLL[_holder];
    }

    function _exist(address _holder) internal view returns (bool) {
        return holderDLL[_holder].next != address(0) || holderDLL[_holder].prev != address(0)
            || (_holder == firstHolder && _holder == lastHolder);
    }
}"
