    "contracts/token/Babbu.sol": {
      "content": "//SPDX-License-Identifier: UNLICENSED
pragma solidity 0.7.5;
pragma abicoder v2;

import "openzeppelin-solidity/contracts/token/ERC20/ERC20.sol";
import "openzeppelin-solidity/contracts/token/ERC20/IERC20.sol";
import "openzeppelin-solidity/contracts/token/ERC20/SafeERC20.sol";
import "openzeppelin-solidity/contracts/token/ERC20/ERC20Capped.sol";
import "openzeppelin-solidity/contracts/token/ERC20/SafeERC20.sol";
import "openzeppelin-solidity/contracts/access/AccessControl.sol";
import "openzeppelin-solidity/contracts/math/SafeMath.sol";
import "openzeppelin-solidity/contracts/token/ERC20/ERC20Burnable.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";
import "../holder/HolderDoubleLinkedList.sol";
import "../pancake/IPancakeFactory.sol";
import "./SwapFeeOwner.sol";
import "hardhat/console.sol";

contract Babbu is
    ERC20("Babbu", "BABBU"),
    ERC20Burnable,
    ERC20Capped(1000000000000 * 10**uint256(18)),
    HolderDoubleLinkedList,
    AccessControl
{
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    address pairAddress;
    address wBNB;

    bool public takeFee = false;
    address public taxPool;
    uint256[3] taxFee;

    SwapFeeOwner feeOwner;

    uint256 constant MAX_INT =
        0xffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffffff;

    constructor(
        address _pancakeFactory,
        address _wBNB,
        address _swapRouter,
        uint256[3] memory _taxFee
    ) {
        require(_pancakeFactory != address(0), "invalid _pancakeFactory address");
        require(_wBNB != address(0), "invalid _wBNB address");
        require(_swapRouter != address(0), "invalid _swapRouter address");
        require( _taxFee[0] + _taxFee[1] + _taxFee[2] < 30, "tax fee too high");

        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _mint(msg.sender, 500000000000 * 10**uint256(18));

        wBNB = _wBNB;
        pairAddress = IPancakeFactory(_pancakeFactory).createPair(
            address(this),
            _wBNB
        );

        _approve(address(this), _swapRouter, cap());
        IERC20(wBNB).safeApprove(_swapRouter, MAX_INT);

        taxFee = _taxFee;
        feeOwner = new SwapFeeOwner(address(this), _wBNB, _pancakeFactory, _swapRouter);
    }

    function _mint(address to, uint256 amount) internal override {
        if (!_exist(to) && !isContract(to)) {
            _add(to);
        }
        super._mint(to, amount);
    }

    function setNftPoolAddress(address _taxPool) public {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Do not have operator role");
        taxPool = _taxPool;
    }

    function setTakeFee(bool _takeFee) public {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Do not have operator role");
        takeFee = _takeFee;
    }

    function mint(address to, uint256 amount) public {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Do not have operator role");
        _mint(to, amount);
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal override(ERC20) {
        if (recipient == pairAddress && takeFee && sender != address(feeOwner)) {
            // tax fee deposit to nft pool
            uint256 nftFee = amount.mul(taxFee[0]).div(100);
            super._transfer(sender, taxPool, nftFee);

            // tax fee deposit to BNB/BABBU pools
            uint256 pairFee = amount.mul(taxFee[2]).div(100);
            super._transfer(sender, address(feeOwner), pairFee);

            feeOwner.addFeeToLiquidityPools(pairFee);

            // tax fee transfer to holders
            uint256 hodlFee = amount.mul(taxFee[1]).div(100);
            hodlFee = transferToHolder(sender, hodlFee);

            amount = amount - nftFee - pairFee - hodlFee;
        }
        super._transfer(sender, recipient, amount);
        updateIndex(sender, recipient, amount);
    }

    /**
     * transfer fee to holder
     */
    function transferToHolder(address sender, uint256 amount) internal returns (uint256 totalFee) {

        // loop through holder DLL
        address next = firstHolder;
        totalFee = 0;
        uint256 holderSupply = 0;
        while (next != address(0)) {
            if (next != sender) {
                holderSupply += balanceOf(next);
            }

            next = holderDLL[next].next;
        }

        next = firstHolder;
        while (next != address(0)) {
            if (next != sender) {
                uint256 transferAmount = amount.mul(balanceOf(next)).div(holderSupply);
                super._transfer(sender, next, transferAmount);
                totalFee += transferAmount;
            }

            next = holderDLL[next].next;
        }
    }

    function isContract(address addr) internal view returns (bool) {
        uint256 size;
        assembly {
            size := extcodesize(addr)
        }
        return size > 0;
    }

    /**
     * update token owner indexes when token transfer happens
     */
    function updateIndex(
        address sender,
        address recipient,
        uint256 amount
    ) internal {
        // remove sender from holder list if transfer all balance
        if (balanceOf(sender) == 0) {
            _remove(sender);
        }

        // add recipient to holder list
        if (amount > 0 && !isContract(recipient) && !_exist(recipient)) {
            _add(recipient);
        }
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal override(ERC20, ERC20Capped) {
        super._beforeTokenTransfer(from, to, amount);
    }

    function withdraw() public {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Do not have operator role");
        msg.sender.transfer(address(this).balance);
    }

    function withdrawErc20(IERC20 token) public {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Do not have operator role");
        token.transfer(msg.sender, token.balanceOf(address(this)));
    }
}
