    "contracts/token/SwapFeeOwner.sol": {
      "content": "//SPDX-License-Identifier: UNLICENSED
pragma solidity 0.7.5;

import "openzeppelin-solidity/contracts/token/ERC20/IERC20.sol";
import "openzeppelin-solidity/contracts/token/ERC20/SafeERC20.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";
import "../pancake/IPancakeFactory.sol";
import "hardhat/console.sol";

contract SwapFeeOwner {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    IERC20 public babbu;
    IERC20 public wBNB;
    IPancakeFactory public pancakeFactory;
    IUniswapV2Router02 public router;
    bool lock = false;

    modifier locked {
        require(!lock, "SwapFeeOwner: reentrancy");
        lock = true;
        _;
        lock = false;
    }

    constructor(
        address _babbu,
        address _wBNB,
        address _pancakeFactory,
        address _router
    ) {
        babbu = IERC20(_babbu);
        wBNB = IERC20(_wBNB);
        pancakeFactory = IPancakeFactory(_pancakeFactory);
        router = IUniswapV2Router02(_router);
    }

    function addFeeToLiquidityPools(uint256 _pairFee) external locked {
        address[] memory path = new address[](2);
        path[0] = address(babbu);
        path[1] = address(wBNB);
        IERC20(babbu).safeIncreaseAllowance(address(router), _pairFee);

        uint256 initBal = address(this).balance;

        //swap half of the tax fee
        router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            _pairFee.div(2),
            0,
            path,
            address(this),
            block.timestamp
        );

        uint256 balInc = address(this).balance.sub(initBal);

        router.addLiquidityETH{value:balInc}(
            address(babbu),
            _pairFee - _pairFee.div(2),
            balInc,
            0, // accept any amount of slippage
            address(this),
            block.timestamp
        );
    }

    fallback() external payable {}

    receive() external payable {}
}
"
